template <typename T> int sgn(T val) {
    return (T(0) < val) - (val < T(0));
}

int main() {
    for (int i=0; i<nmeasures; i++) { // rescale input data
        voltage[i] *= .0941; // bring it to real volts
        for (int j=0; j<nsamples; j++) {
            speeds[i][j] *= .005; // bring it to m/s
        }
    }

    double w[nmeasures];
    for (int i=0; i<nmeasures; i++) {  // find speeds limits
        w[i] = 0;
        int cnt = 0;
        for (int j=nsamples-15; j<nsamples; j++) {
            w[i] += speeds[i][j];
            cnt++;
        }
        w[i] /= cnt;
    }

    std::ofstream flimits;
    flimits.open ("limits.dat", std::ofstream::out | std::ofstream::trunc);
    for (int i=0; i<nmeasures; i++) {  // dump final speed vs voltage graph
        if (w[i]>0) {
            flimits << voltage[i] << " " << w[i] << std::endl;
        }
    }
    flimits.close();


    double a = 0;
    double b = 0;
    double c = 0;

    double best_energy = std::numeric_limits<double>::max();
    for (double ta=1.; ta>.7; ta-=.001) {
        nlNewContext();
        nlSolverParameteri(NL_NB_VARIABLES, 2);
        nlSolverParameteri(NL_LEAST_SQUARES, NL_TRUE);

        nlBegin(NL_SYSTEM);
        nlBegin(NL_MATRIX);

        for (int i=0; i<nmeasures; i++) {
            nlBegin(NL_ROW);
            nlCoefficient(0,     voltage[i]);
            nlCoefficient(1, sgn(voltage[i]));
            nlRightHandSide(w[i]-ta*w[i]);
            nlEnd(NL_ROW);
        }

        nlEnd(NL_MATRIX);
        nlEnd(NL_SYSTEM);

        nlSolve();

        double tb = nlGetVariable(0);
        double tc = nlGetVariable(1);

        nlDeleteContext(nlGetCurrent());

        double energy = 0;
        for (int i=0; i<nmeasures; i++) {
            double wk = speeds[i][0];
            for (int j=0; j<nsamples; j++) {
                energy += pow((speeds[i][j] - wk)/voltage[i], 2.);
                wk = ta*wk + tb*voltage[i] + tc*sgn(voltage[i]);
            }
            if (energy<best_energy) {
                best_energy = energy;
                a = ta;
                b = tb;
                c = tc;
            }
        }
    }

    std::cerr << a << " " << b << " " << c << std::endl;

    std::ofstream fcurves;
    fcurves.open ("curves.dat", std::ofstream::out | std::ofstream::trunc);

    double wk[nmeasures];
    for (int i=0; i<nmeasures;i++) {
        wk[i] = speeds[i][0];
    }
    for (int j=0; j<nsamples; j++) {
        fcurves << j*.002 << " ";
        for (int i=0; i<nmeasures; i++) {
            fcurves << speeds[i][j] << " ";
        }

        for (int i=0; i<nmeasures; i++) {
            fcurves << wk[i] << " ";
            wk[i] = a*wk[i] + b*voltage[i] + c*sgn(voltage[i]);
        }
        fcurves << std::endl;

    }
    fcurves.close();

    return 0;
}

